/* Function  structure for function  `CurrentMissionSequence` */

/*!50003 DROP FUNCTION IF EXISTS `CurrentMissionSequence` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `CurrentMissionSequence`() RETURNS char(12) CHARSET latin1
BEGIN
	declare result char(12);
	SELECT MAX(`Campaign_Sequence`) into result FROM `sector_status`;
	return result;
    END */$$
DELIMITER ;

/* Function  structure for function  `intNationality` */

/*!50003 DROP FUNCTION IF EXISTS `intNationality` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `intNationality`(strNationality CHAR(6)) RETURNS int(1)
BEGIN
	Declare result INT;
	If (UCASE(strNationality) = 'R' Or UCase(strNationality) = 'ALLIED') Then SET result = 1;
	ElseIF (UCase(strNationality) = 'G' Or UCase(strNationality) = 'AXIS') Then SET result = 2;
	Else SEt result = 0;
	End If;
	return result;
    END */$$
DELIMITER ;

/* Function  structure for function  `NextMissionSequence` */

/*!50003 DROP FUNCTION IF EXISTS `NextMissionSequence` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `NextMissionSequence`() RETURNS char(12) CHARSET latin1
BEGIN
DECLARE LMD datetime; -- this variable will store the "last mission" as a datetime type
DECLARE MLD TIME; -- this variable will store the mission lenght as a time type 
DECLARE NMD dateTIME; -- this variable will store the 'last mission time + mission length' as a datetime type
DECLARE NMDC char (12); -- this variable will store the NMD as a STRING
SELECT STR_TO_DATE (MAX(`sector_status`.`Campaign_Sequence`), '%Y%m%d%H%i') into LMD FROM `sector_status` WHERE `sector_status`.`Campaign_Status`= ('analyzed' OR 'ClockAdvance'); -- the last mission date time
SELECT STR_TO_DATE (campaign_settings.`Mission_Length`, '%H') INto MLD FROM campaign_settings; -- the mission lenght in hours
set NMD = addTIME(LMD,MLD); -- the addition 
SET NMDC= CAST(DATE_FORMAT(NMD, '%Y%m%d%H%i') AS CHAR); -- the addition as a string
return NMDC;
END */$$
DELIMITER ;

/* Function  structure for function  `STRMissionSequence` */

/*!50003 DROP FUNCTION IF EXISTS `STRMissionSequence` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `STRMissionSequence`(MissionFieldName CHAR(255)) RETURNS char(12) CHARSET latin1
BEGIN
	DECLARE result CHAR(12);
		IF LOCATE('00.',`MissionFieldName`) > 0 then set result = SUBSTRING(`MissionFieldName`, LOCATE('00.',`MissionFieldName`) - 10 , 12);
		ELSE set result = NULL;
	END if;
	return result;
    END */$$
DELIMITER ;

