insert  into `sector_design_notes`(`Sector`,`Design_Notes`) values 
('Africa_NE','1. Industrial_Installation Table and Railways_Stations Table were built from the original actors.static. Fuel dumps(IndustrialFactoryTank1) and factories (IndustrialFactoryConstruction1) . There are numerous and you can remove some of them by editing the tables./n2. All airbases were checked. Their Takeoff and Landing points have been checked with the airbase layouts./n3. Grass airfields appear as Temporary airbases, All others are concrete airbases. You can change it as you want by changing the airbase layout number./n4. All highways and railways have been checked. No wrong intersections. No short roads (min number of WP = 4)./n5. All texts of the intel image are linked./n6. Africa_NW and Africa_NE maps (Algeria_Tunisia_Sicilia and Northern Africa maps) were built together for 1942-1943 multisectors scenarios./nHave fun!/nJP - (PA-Dore)'),
('Africa_NW','1. Industrial_Installation Table and Railways_Stations Table were built from the original actors.static. Fuel dumps(IndustrialFactoryTank1) and factories (IndustrialFactoryConstruction1) . There are numerous and you can remove some of them by editing the tables./n2. All airbases were checked. Their Takeoff and Landing points have been checked with the airbase layouts./n3. Grass airfields appear as Temporary airbases, All others are concrete airbases. You can change it as you want by changing the airbase layout number./n4. All highways and railways have been checked. No wrong intersections. No short roads (min number of WP = 4)./n5. All texts of the intel image are linked./n6. Africa_NW and Africa_NE maps (Algeria_Tunisia_Sicilia and Northern Africa maps) were built together for 1942-1943 multisectors scenarios./nHave fun!/nJP - (PA-Dore)'),
('Battle of Moscow','1. Industrial_Installations Table contains all fuel dumps (House$FTankS_01) and factories (IndustrialFactoryConstruction1) from the actors.static. They are very numerous, many of them can be removed by admin. <br><br>2. Railway_Stations Table was built from the original actors.static. Many railways platforms or stations could allow the Heavy Rail Freight Only at Train Stations option of the DCS. <br><br>3. All airbases were checked. Their Takeoff and Landing points have been checked with the airbase layouts.<br>Grass airfields appear as temporary airbases, all others are concrete airbases.    <br>This can be changed modifying the airbase layout number.<br><br>4. All highways, roads and railways have been checked.    <br>No wrong intersections. No short roads (min number of WP = 4).<br><br>5. Moscow city: I have built some virtual roads and road bridges. They do not exist in the game but they are efficient in SEOW: If normal movements have been choosen in the campaign settings, vehicles will follow these virtual roads. Virtual bridges cannot be destroyed by players, but only by engineers or admin. By default, they are destroyed.<br><br>6. All texts of the intel image are linked.<br><br>Have fun!<br>JP'),
('Borneo','1. Only short roads and railways closed to some airbases.<br><br> 2. Airbases (15) were checked. Takeoff and Landing points have been checked for AI and all airbase layouts have been checked (night mission).<br><br>3. Factories are located at Tarakan only.<br><br>4. All texts of the intel image are linked.<br><br>Have fun!<br><br>JP - (PA-Dore) 2013'),
('Burma','1. No Industrial_Installations were located. Campaign administrators could add them if needed.<br>2. All airbases were checked (TAKEOFF and LANDING). Their takeoff and landing points have been checked with the airbase layouts.<br>3. Grass airfields appear as Temporary airbases if Temporary Airbases = 1 in Campaign Settings, all others are normal  airbases. You can change it as you want by changing the airbase layout number.<br>4. All highways and railways have been checked. No wrong intersections. No short roads (Number of Highways WP >=4, number of Railways WP >=3 ).<br>5. All texts of the intel image are linked.<br>7. A radar map has been captured (non historical in Burma 1941).<br>8. No bridges on this map. Little rivers can be crossed by ground units. I put route blockages (rail and roads) for large rivers <br><br>Have fun!<br>JP - (PA-Dore)'),
('IF_Baranow','1. Iron Front actions (ground) only'),
('IF_Staszow','1. Iron Front actions (ground) only'),
('Italy Exp','1. All 106 airbases were checked. Takeoff and Landing points have been checked for AI and all airbase layouts have been checked ( night mission ).<br><br>2.  It is recommended to use correct landing points, as map terrain has hills near some bases ( on some bases if different landing point is used some type of AI bombers will crash on default landing pattern ).<br><br>3. Map positions of all Fuel dumps in citys and Fuel tanks on airbases are captured, together  with positions of all Factories on map ( object name is IndustrialFactoryConstruction1 ) .<br><br>4. All highways and railways have been checked. No wrong intersections. No short roads or railways (min number of WP = 3).<br><br>5. All texts of the intel image are linked.<br><br>Have fun!<br><br>StG77_CountZero 2014'),
('Italy_Africa_Greece','1. Italy_Greece map could replace Italy_Africa_Greece north map.<br><br> 2. All 80 airbases were checked. Takeoff and Landing points have been checked for AI and all airbase layouts have been checked (night mission).<br><br>3. Industrial_Installation Table was built from the original actors.static: Fuel dumps(IndustrialFactoryTank1) and factories (IndustrialFactoryConstruction1) .<br><br>4. All highways have been checked. No wrong intersections. No short roads (min number of WP = 4).<br><br>5. All texts of the intel image are linked.<br><br>6. No railways in Italy_Africa_Greece sector<br><br>Have fun!<br><br>JP - (PA-Dore)'),
('Marianas Exp','1. Industrial_Installations Table contains all fuel dumps and factories from the actors.static.<br><br>2. All airbases were checked. Their Takeoff,Landing points and Layouts have been checked in a real SEOW night mission.<br><br>3. All highways and railways have been checked. They may not be useful in the Marianas campaigns; they were captured as part of the SEOW coordinate mapping process.<br>No wrong intersections. No short Highways (min number of WP = 4).<br><br>4. All texts of the intel image are linked.<br><br>Have fun!<br>JP (C6_Dore) January 2015'),
('Palau','1. No roads, no railways, no bridges on this map.<br><br> 2. Airbases (3) were checked. Takeoff and Landing points have been checked for AI and all airbase layouts have been checked (night mission).<br><br>3. All texts of the intel image are linked.<br><br>Have fun!<br><br>JP - (PA-Dore) 2013'),
('Palembang','1. One bridge is missing in Palembang City but ground units can cross the river.<br><br> 2. All airbases were checked. Takeoff and Landing points have been checked for AI and all airbase layouts have been checked (night mission).<br><br>3. The Palembang AF airbase does not exist un the original map. This airbase has been added as a temporary airbase (layout = 1502). It will appear if Temporary Airbases = 1 in Campaign Settings.<br><br>4. All highways and railways have been checked. No wrong intersections. No short roads (min number of WP = 4).<br><br>5. All texts of the intel image are linked.<br><br>Have fun!<br><br>JP - (PA-Dore)'),
('Provence','Provence Italy map for Operation Dragoon 15 august 1944 by Spit973.<Br>1.All roads and railways have been checked. No wrong intersections<br>2. All airbases have been checked for AI take-off<br>3. IL2 1946 has a limit X=1 000 000 m. So the eastern part of the map cannot be flown by AI aircraft.<br> Ground units and human flights are allowed. Only human landings can be ordered on the 4 airbases in the south of Italy.<br>4. 3 kinds of bridges are present in this map, Metal, Wooden and Concrete.<br>Concrete bridges are set as Metal for statistics convenience.<br>5. Industrial objects located on the harbour platforms of Marseille and Toulon cannot be destroyed.<br>They are not exactly at the ground level, so, the target object would be hidden.<br>I removed these industrial records from the database<Br>Have fun JP PA-Dore June 2017.'),
('Sakishima','1. During the invasion of Okinawa in this map sector the British Pacific Fleet had the task to prevent use of kamikaze and bombers from Sakishima-Gunto islands on the Allied ships in Okinawa area.<br> Task Force 57 carriers launched multiple raids on airbases on islands Myako-Jima and Ishigaki-Shima during periods from March 25-April 9, April 16-20 and May 3-25 in 1945.<br> Imperial Japan airforce at time of battle lanched several succesfule kamikaze attacks on TF-57 ships, hitting and damaging a few British carriers, but serious damage was prevented by steel decking.<br><br>2. All five airbases were checked for take off and landing for AI, and all airbase layouts have been checked for night and day missions. <br><br> 3. Airplanes landing at the seabase will sometimes be damaged on landing, because they turn off their engines on last waypoint before landing.<br> This happens because the seabase does not exist on the IL-2map. The campaign admin should take notice of that and order last waypoint close to base.<br><br>4. Map has no railroads, no bridges, and no industrial installations. All highways on islands have been captured and checked, no wrong intersections and no short roads (min number of WP = 4).<br><br>5. All texts of the intel image are linked.<br><br>6. On these links you may find info for the actual units based on the islands during Operation Iceberg: http://forum.axishistory.com/viewtopic.php?p=1901366&sid=e4faf1c1a3400e65e6dcfe664b49eab7#p1901366 <br>  Info about TF-57: http://www.armouredcarriers.com/task-force-57-british-pacific-fleet/ .<br><br>7. Note that the Sector_Dominance table contains Japan - Britain as mostly British navy saw action here, but campaign administrator can change Britain to USA if needed<br><br>Have fun!<br><br>Dore & CountZero April 2015.'),
('Santa Cruz','1. No railways, only Highways and road bridges no bridges on this map.<br><br> 2. Airbases (6) were checked. Takeoff and Landing points have been checked for AI and all airbase layouts have been checked (night mission).<br><br>3. All texts of the intel image are linked.<br><br>Have fun!<br><br>JP - (PA-Dore) 2013'),
('Thailand','1. No Industrial_Installations were located. Campaign administrators could add them if needed.<br><br>2. All airbases were checked (TAKEOFF and LANDING). Their Takeoff and Landing points have been checked according with the airbase layout type.<br><br>3. Grass airfields appear as Temporary airbases if Temporary Airbases = 1 in Campaign Settings, all others are normal  airbases. You can change it as you want by changing the airbase layout number.<br><br>4. All highways and railways have been checked. No wrong intersections. No short roads (Number of Highways WP >=4, number of Railways WP >=3 ).<br><br>5. All texts of the intel image are linked.<br><br>7. A radar map has been captured (non historical).<br><br>8. No bridges on this map. Little rivers can be crossed by ground units. <br><br>Have fun!<br>JP - (PA-Dore)'),
('The Fall','1. Industrial_Installations Table contains all fuel dumps (House$FTankS_01) and factories (IndustrialFactoryConstruction1) from the actors.static. Only some cities are populated. <br><br>2. No Railway_Stations.If needed, Railway_Stations table can be built and buildings added by the admin in the campaign template. They will be recorded in the Scenery Table.<br><br>3. All airbases were checked. Their Takeoff,Landing points and Layouts have been checked in a real SEOW night mission.<br>Grass airfields appear as temporary airbases, all others are concrete airbases.<br><br>4. All highways, roads and railways have been checked.<br>No wrong intersections. No short Highways (min number of WP = 4 except 3 roads of 3 WP).<br><br>5. All texts of the intel image are linked.<br><br>6. Winter and Summer campaigns can be built using the same database and Mission Planner sector. <br><br>Have fun!<br>JP (C6_Dore) January 2015'),
('Truk','1. For sea airbases aditional objects are added in airbases layouts ( House$TankObstacle1 ) to prevent AI sea airplanes from crashing or geting destroyed after they land and park on default STAY spawn point (usealy, as AI airplanes dont disappear after parking, with time wind will move them to land).  With thouse eight objects in sea airbase layout table, AI sea airplanes will after landing just disappear or be removed, and not taxi to default seabase STAY spawn points, in stats they will count as landed<br><br> 2. All six airbases were checked for take off and landing for AI, and all airbase layouts have been checked in night and day mission.<br><br>3. Map has one short railway on Dublon, one highway and one road bridge at Dublon and Moen.<br><br>4. Insted factorys, repair facilitys are placed on Dublon, and can be used, fuel tanks are captured also on air bases as well with rest of fuel tank objects on islands<br><br>Have fun!<br><br>StG77_CountZero 2014, thanks to =VARP=Thor and PA-Dore for help'),
('West Front 40','1. Industrial_Installations and Railways_Stations Tables were built from the original actors.static fuel dumps<br>(IndustrialFactoryTank1) and factories (IndustrialFactoryConstruction1).<br>Some of the names of the factories are companies that were present in 1940 for historical immersion.<br><br>2. All airbases were checked. Their Takeoff and Landing points have been checked with the airbase layouts.<br>Please note many are very short runways so planners need to be aware of short takeoffs and aircraft loadouts when planning.<br><br>3. All highways and railways have been checked. No wrong intersections. No short roads (Number of Highways and Railways WP >=3 ).  There are 4 road route blockages (Rotterdam 1, Antwerp 3) on map due to mapping errors on West Front 40 map.<br><br>4. All texts of the intel image are linked.<br><br>5.  Special thanks to the members of the SEOWHQ Team that worked on this project:<br>1.JaVA_Jojo, JG26_Scannon, Kopdorfer, JP(PA-Dore), WTE_Ikey and 4Shades - thanks fellas!.<br><br>6. The West Front 40 SEOW mission planner map is dedicated to our dearly departed friend II/JG77Hawk_5, a dedicated member of the SEOW community.<br>RIP Peter !<br><br>Enjoy and have fun!<br>JG26_Badger '),
('West Front 44','1. Industrial_Installation Table and Railways_Stations Table were built from the original actors.static fuel dumps (IndustrialFactoryTank1) and factories (IndustrialFactoryConstruction1). These are numerous and you can remove some of them by editing the tables.<br>2. All airbases were checked. Their Takeoff and Landing points have been checked with the airbase layouts. Grass airfields appear as temporary airbases, all others are concrete airbases. You can change these as you want by changing the airbase layout number.<br>3. All highways and railways have been checked. No wrong intersections. No short roads (Number of Highways WP >=4, number of Railways WP >=3 ).<br>4. All texts of the intel image are linked.<br>5. All West Front 44 maps can be used: WestFront44 (Winter) and WestFront44Summer are different. By default, I captured the Winter Map. For Summer map just change the 7 following tables to Summer tables:<br>Airbases, Bridges, Highways, Highway_Intersections, Railway_Waypoints, Railway_Intersections and Tile_Map_Codes.<br>Summer datas could be used with WestFront44 generic maps (Spring, Autumn...)<br>6. Several radar maps could be used by changing the name in the Radar_Maps.php.<br>7. Using these 2 maps you could run a campaign in 2 periods. Take as an example:<br>- 1st period: 1944/09/17 08:00 18:00Summer map<br>- 2nd period: 1944/12/16 08:00 Winter map<br>7.1. CLOCK ADVANCE --> 1944, September 18 08:00 --> 194409180800<br>7.2. Combined_Unit_Status: Change SE-WF-194409180600.mis to SE-WF-194412160600.mis<br>UPDATE Combined_Unit_Status SET Combined_Unit_Status.Mission = &quot;SE-WF-194412160600.mis&quot; WHERE Combined_Unit_Status.Mission = &quot;SE-WF-194409180600.mis&quot;<br>7.3.MissionData<br> UPDATE MissionData SET MissionData.Mission_Name = &quot;SE-WF-194412160600.mis&quot; WHERE MissionData.Mission_Name = &quot;SE-WF-194409180600.mis&quot;<br>and modify date 16 Dec 1944<br>7.4. ObjMissionData<br>UPDATE ObjMissionData SET ObjMissionData.Mission_Name = &quot;SE-WF-194412160600.mis&quot; WHERE ObjMissionData.Mission_Name = &quot;SE-WF-194409180600.mis&quot;<br>7.5. Ship_Damage_Status<br>UPDATE Ship_Damage_Status SET Ship_Damage_Status.Mission_Name = &quot;SE-WF-194412160600.mis&quot; WHERE Ship_Damage_Status.Mission_Name = &quot;SE-WF-194409180600.mis&quot;<br>7.6. Waypoints<br>UPDATE Waypoints SET Waypoints.Mission_Name = &quot;SE-WF-194412160600.mis&quot; WHERE Waypoints.Mission_Name = &quot;SE-WF-194409180600.mis&quot;<br>7.7.Sector_Status<br>UPDATE Sector_Status SET Sector_Status.Campaign_Sequence = &quot;194412160600&quot; WHERE Sector_Status.Campaign_Sequence = &quot;194409180600&quot;<br>7.8.Task_Forces<br>UPDATE Task_Forces SET Task_Forces.Mission_Sequence = &quot;194412160800&quot; WHERE Task_Forces.Mission_Sequence = &quot;194409180800&quot;<br>7.9.Industrial_Installations<br>UPDATE Industrial_Installations SET Industrial_Installations.Event_Date = &quot;194412150800&quot; WHERE Industrial_Installations.Event_Date  = &quot;194409170800&quot;<br>7.10.Sector_Weather<br>Replace all 19440918xxxx par 19441216xxxx<br>Replace all 19440919xxxx par 19441217xxxx<br><br>Have fun!<br>JP - (PA-Dore)'),
('Western Carolines','1. No railways, only Highways and 2 road bridges at Yap.<br><br> 2. Airbases (5) were checked. Takeoff and Landing points have been checked for AI and all airbase layouts have been checked (night mission).<br><br>3. All texts of the intel image are linked.<br><br>Have fun!<br><br>JP - (PA-Dore) 2013');
